window.bookSummaryJSON = "<p>Epic adventures. Fierce warrior cats. A thrilling fantasy world. It all begins here. </p> <p>Listen to the book that began a phenomenon - and join the legion of fans who have made Erin Hunter's Warriors series a number-one national best seller. </p> <p>For generations, four Clans of wild cats have shared the forest according to the laws laid down by their ancestors. But the warrior code has been threatened, and the ThunderClan cats are in grave danger. The sinister ShadowClan grows stronger every day. Noble warriors are dying - and some deaths are more mysterious than others. </p> <p>In the midst of this turmoil appears an ordinary housecat named Rusty...who may turn out to be the bravest warrior of them all. </p>"; 
